import React from 'react';
import {Link} from 'react-router-dom'
import './App.css';


function App() {
  return (
    <div className="App">
      <nav>
        <Link to = '/'>Home</Link>{" "}
        <Link to = '/about'>About</Link>{" "}
        <Link to = '/blog'>Blog</Link>{" "}
        <Link to = '/skills'>Skills</Link>
      </nav>
      <h1>Welcome To My Website</h1>
    </div>
  );
}

export default App;
